    <title>Interactive Page</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Baloo+2:wght@700&display=swap');

        body {
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            background-color: pink;
            font-family: 'Baloo 2', cursive;
            background-image: url('https://img.freepik.com/free-vector/cute-small-love-heart-pattern-wallpaper-textile-fabric-print_1017-49356.jpg?w=1380&t=st=1717321484~exp=1717322084~hmac=0ce4b5d0746a41bd99da0a85c039b020177c44f2f04503dcc823d2eb315c791d');

            text-align: center;
        }

        .label {
            font-size: 48px;
            font-weight: bold;
            background: linear-gradient(45deg, pink, red);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            margin-bottom: 20px;
            text-shadow: -1px -1px 0 #000, 1px -1px 0 #000, -1px 1px 0 #000, 1px 1px 0 #000; /* Adding black outline */
        }

        .buttons {
            display: flex;
            gap: 20px;
        }

        button {
            padding: 10px 20px;
            font-size: 24px;
            cursor: pointer;
            border: none;
            border-radius: 8px;
            transition: background-color 0.3s, transform 0.2s;
            text-shadow: -1px -1px 0 #000, 1px -1px 0 #000, -1px 1px 0 #000, 1px 1px 0 #000; /* Adding black outline */
        }

        .yes-button {
            background-color: #2ecc71;
            color: white;
        }

        .no-button {
            background-color: #e74c3c;
            color: white;
        }

        button:hover {
            transform: scale(1.1);
        }
    </style>
</head>
